import React, {Component} from 'react';
import logo from './logo.svg';
import './App.css';
import Todos from './Todos'


function App() {
  state = {
    todos: [
      {id:1, content: "test 1"},
      {id:2, content: "test 2"}
    ]
  }
  return (
    <div className="App">
      <h1 className="centre blue-text">
        Todo's
      </h1>
      <Todos todos={this.state.todos}/>
    </div>
  );
}

export default App;
